import PhoneImg from "../assets/Phones.svg";
import Watch from "../assets/watch.svg";
import Camera from "../assets/camera.svg";
export const categoryData = [
  {
    Img: PhoneImg,
    name: "Phones",
  },
  {
    Img: Watch,
    name: "Smart Watches",
  },
  {
    Img: Camera,
    name: "Cameras",
  },
  {
    Img: PhoneImg,
    name: "Headphones",
  },
  {
    Img: PhoneImg,
    name: "Computers",
  },
  {
    Img: PhoneImg,
    name: "Gaming",
  },
];
